import {BarChart, XAxis, YAxis, Tooltip, Legend, Bar,CartesianGrid} from 'recharts';

let data = [
    {
        "name": "Snowflake",
        "exp": 3.2
    },

    {
        "name": "Python",
        "exp": 5
    },
    {
        "name": "Huggingface",
        "exp": 1
    },
    {
        "name": "bash",
        "exp": 1
    },
    {
        "name": "dbt",
        "exp": 2
    },
    {
        "name": "Looker",
        "exp": 1
    },
    {
        "name": "Tableau",
        "exp": 1
    },
    {
        "name": "NodeJS",
        "exp": 0.7
    },
    {
        "name": "React",
        "exp": 0.5
    },
    {
        "name": "SQL",
        "exp": 5
    },
    {
        "name": "Linux",
        "exp": 1
    }
].sort((a, b) => b.exp - a.exp);


export default function SkillBar(){
    return (

                    <BarChart width={1000} height={630} data={data} layout='horizontal'>
                    <CartesianGrid strokeDasharray="5 5" />
                        <XAxis dataKey="name" />
                        <YAxis />
                        <Tooltip />
                        <Legend />
                        <Bar dataKey="exp" stackId="a" fill="#49416D" />
                    </BarChart>

    );
}
